import React from 'react';
import './AboutUsPage.css';

function AboutUsPage() {
  const teamMembers = [
    {
      name: 'Alice Smith',
      role: 'Project Manager',
      image: 'alice.jpg',
      linkedin: 'https://www.linkedin.com/in/alice-smith',
      github: 'https://github.com/alicesmith'
    },
    {
      name: 'Bob Johnson',
      role: 'Lead Developer',
      image: 'bob.jpg',
      linkedin: 'https://www.linkedin.com/in/bob-johnson',
      github: 'https://github.com/bobjohnson'
    },
    {
      name: 'Charlie Brown',
      role: 'UX Designer',
      image: 'charlie.jpg',
      linkedin: 'https://www.linkedin.com/in/charlie-brown',
      github: 'https://github.com/charliebrown'
    }
  ];

  return (
    <div className="about-us-page">
      <div className="music-background"></div>
      <h2>About Our Project</h2>
      <p>This project is a music generation platform that allows users to create and customize their own music tracks.</p>
      <div className="team-section">
        {teamMembers.map((member) => (
          <div className="team-member" key={member.name}>
            <div className="image-container">
              <img src={member.image} alt={member.name} className="team-image" />
              <div className="overlay">
                <a href={member.linkedin} target="_blank" rel="noopener noreferrer">
                  <i className="fab fa-linkedin"></i>
                </a>
                <a href={member.github} target="_blank" rel="noopener noreferrer">
                  <i className="fab fa-github"></i>
                </a>
              </div>
            </div>
            <h3>{member.name}</h3>
            <p>{member.role}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AboutUsPage;
